    null,ntt"hash": "",ntt"description": "ZIP file containing Source files
    for non-standard code versions used to run model simulations included in the data
    release. MODFLOW-NWT (v 1.0.8) was modified to include the General Finite-Difference
    (GFD) boundary condition package. A 64-bit version of ZONEBUDGET (v 3.01) was created
    to calculate water budgets for select areas of the model domain. The cluster_repo
    python package has also been included because several of the python post-processing
    scripts use the functionality in package classes and methods. In particular, the
    classes and methods in shapefile.py and pestUtil.py are used. cluster_repo requires
    NumPy 1.9 or higher and pandas 0.15.2 or higher. This ZIP file should be unzipped
