    {ntt"total": 48,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-05-25T02:57:22.373291",nt"name": "modflow-nwt-model-used-to-evaluate-the-potential-effect-of-groundwater-pumpage-and-increased-se",nt"isopen":
    false,nt"url": null,nt"notes": "A three-dimensional, surface-water/groundwater
    model (MODFLOW-NWT with the Surface-Water Routing Process) was developed to the
    predict the effects of groundwater pumpage on canal leakage and regional groundwater
    flow in urban portions of Miami-Dade County, Florida. The model was calibrated by
    using observation data collected from 1997 through 2004. The model calibration was
    verified using observation data collected from 2005 through 2010. The model is designed
    to simulate surface-water stage and discharge in the managed canal system and dynamic
    canal leakage to the Biscayne aquifer as well as seepage to the canal from the aquifer.
    The model was used to evaluate the effect of increased groundwater pumpage and (or)
    increased sea level on canal leakage, regional groundwater flow, and the position
    of the freshwater-seawater interface. This USGS data release contains all of the
    input and output files for the simulations described in the associated model documentation
    report (http://dx.doi.org/10.3133/sir20145162). This data release also includes
    (1) postprocessing python scripts, (2) python source code used by pre-processing
    scripts, (3) MODFLOW-NWT (v 1.0.8) source code with the General Finite Difference
    (GFD) boundary package, and (4) ZONEBUDGET (v 3.01) source code.",nt"license_title":
